function submitData() {
  for (
    var t = document.getElementsByTagName("select"), n = [], i = 0;
    i < t.length;
    i++
  ) {
    var s = t[i],
      e = s.value;
    e && n.push({ id: s.id, value: e });
  }
  for (var o = 0; o < n.length; o++) {
    var a = n[o];
    console.log("Dropdown ID: " + a.id + ", AusgewÃ¤hlter Wert: " + a.value);
  }
}
